import React, { useState } from 'react';
import { addCar } from '../api';

const AddCarForm = ({ onCarAdded }) => {
  const [brand, setBrand] = useState('');
  const [engineType, setEngineType] = useState('');

  const handleSubmit = async (e) => {
    e.preventDefault();
    await addCar(brand, engineType);
    setBrand('');
    setEngineType('');
    onCarAdded();
  };

  return (
    <form onSubmit={handleSubmit}>
      <h2>Add New Car</h2>
      <input value={brand} onChange={e => setBrand(e.target.value)} placeholder="Brand" required />
      <input value={engineType} onChange={e => setEngineType(e.target.value)} placeholder="Engine Type" required />
      <button type="submit">Add Car</button>
    </form>
  );
};

export default AddCarForm;
